import orderList from '@/views/OrderList.vue';
import tableList from '@/views/TableList.vue';
import { listData } from '@/mixins/listData.js';
export default {
  mixins: [listData],
  //混入，先执行混入的钩子再执行本页面钩子
  components: {
    orderList: orderList,
    tableList: tableList
  },
  data: function data() {
    return {
      menu: false,
      menu1: false
    };
  },
  methods: {
    dateF: function dateF(e) {
      var arr = e.split('-');
      return arr[2];
    },
    startTimeOk: function startTimeOk() {
      //开始时间选择器-确定
      this.menu = false;
      this.$refs.menu.save(this.shortStart);
      this.startTime = this.$moment(this.shortStart).format('YYYY-MM-DD HH:mm:ss');
    },
    endTimeOk: function endTimeOk() {
      //结束时间选择器-确定
      this.endTime = this.$moment(this.shortEnd).set('hour', 23).set('minutes', 59).set('seconds', 59).format('YYYY-MM-DD HH:mm:ss');
      this.$refs.menu1.save(this.shortEnd);
      this.menu1 = false;
    }
  }
};
